import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import './Questionnaire.css'; // if you have styles

const Questionnaire = () => {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    mood: '',
    sleep: '',
    energy: '',
    appetite: '',
    interest: '',
    irritability: '',
    concentration: '',
    feelingWorthy: '',
    anxiousThoughts: '',
    panicAttacks: '',
    user_id: '' // optional if you collect user id
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5001/submit', formData);
      console.log('Prediction:', response.data.prediction);

      // Save prediction locally
      localStorage.setItem('prediction', JSON.stringify(response.data.prediction));

      // Navigate to result page
      navigate('/result');
      
    } catch (error) {
      console.error('❌ Error submitting data:', error);
    }
  };

  return (
    <div className="questionnaire-container">
      <h2>Mental Health Questionnaire</h2>
      <form onSubmit={handleSubmit}>

        {Object.keys(formData).filter(key => key !== 'user_id').map((key) => (
          <div key={key} className="form-group">
            <label>{key}</label>
            <input
              type="text"
              name={key}
              value={formData[key]}
              onChange={handleChange}
              required
            />
          </div>
        ))}

        {/* Optional: User ID */}
        <div className="form-group">
          <label>User ID (optional)</label>
          <input
            type="text"
            name="user_id"
            value={formData.user_id}
            onChange={handleChange}
          />
        </div>

        <button type="submit" className="submit-btn">Submit</button>
      </form>
    </div>
  );
};

export default Questionnaire;
